 * @param size  The number of hits to retain.  Must be greater than zero.
 * @throws IOException
 */
FieldDocSortedHitQueue (SortField[] fields, int size)
throws IOException {
	this.fields = fields;
	this.collators = hasCollators (fields);
	initialize (size);
}

